  //       <p>{r}</p>
  //     </>;
  //   });
  // for (let data of Object.values(ros)) {
  //   return (
  //     <>
  //       <p>{data}</p>
  //       <br />
  //     </>
  //   );
  // }

  const parseAnnounces = () => {
    for (let i = 1; i <= 5; i++) {
      <>
        <span>
          <h3>Announce</h3>
          <p>{ros[`announce_${i}`]}</p>
        </span>
        <span>
          <h3>Our Father</h3>
          <p>{ros.our_father_1}</p>
        </span>
        <span>
          <h3>Hail Mary X10</h3>
          <small>*While meditating on the rosary mystery*</small>
          <p>{ros["hail _mary_1"]}</p>
        </span>
        <span>
          <h3>Glory Be to the Father</h3>
          <small>*Holding Chain*</small>
          <p>{ros.glory_be_1}</p>
        </span>
        <span>
          <h3>Fatima Prayer (oh my Jesus)</h3>
          <p>{ros.oh_my_jesus_1}</p>
        </span>
      </>;
    }
    return;
  };

  return (
    <div>
      <h1>Home page</h1>
      {/* <div>
        {Object.values(ros).map((r) => (
          <p>{r}</p>
        ))}
      </div> */}
      <span>
        <h3>Apostles Creeed</h3>
        <small>*Holding Crucifix*</small>
        <p>{ros.i_believe}</p>
      </span>
      <span>
        <h3>Our Father</h3>
        <p>{ros.our_father_1}</p>
      </span>
      <span>
        <h3>Hail Mary X3</h3>
        <p>{ros["hail _mary_1"]}</p>
      </span>
      <span>
        <h3>Glory Be to the Father</h3>
        <small>*Holding Chain*</small>
        <p>{ros.glory_be_1}</p>
      </span>
      {/* {parseAnnounces()} */}
    </div>
  );
};

export default Home;
